import React from 'react';
import Container from "@material-ui/core/Container";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const Names = ({formData, setForm, navigation}) => {
    const {firstName, lastName, nickName}=formData;
    console.log(navigation);
    return (
       <Container maxWidth="xs">
           <h1>Names</h1>
           {/* first Name */}
           <TextField   label="First Name" name="firstname" value={firstName} onChange={setForm} margin="normal" variant="outlined" autoComplete="off" fullWidth/>

           {/* last Name */}
           <TextField   label="Last Name" name="lastname" value={lastName} margin="normal" variant="outlined" autoComplete="off" fullWidth/>

           {/* NickName */}
           <TextField   label="Nick Name" name="nickname" value={nickName} margin="normal" variant="outlined" autoComplete="off" fullWidth/>

           <Button variant="contained" fullWidth color="primary" style={{ marginTop: "1rem" }}>Next</Button>
       </Container>
    )
}

export default Names;
